   /******************************************************************************/
   // Feature name: AWB Green Tuning.
   //
   // Variable name: green_proj.
   // Enable or disable green zone.
   // Default value: 1.
   // Data range : 0 (disable) or 1 (enable).
   //
   // Variable name: green_offset_bg.
   // Green offset b/g for top part of the green zone, and the bottom part of the green zone will move together.
   // Comparing to existing green zone, negative green_offset_bg moves the zone down and positive value moves zone up.
   // Default value: -70 (Setting this value is like disabling green zone before tuning).
   // Recommended data range: -70 to 70.
   // Recommended tuning step: -1 or 1.
   //
   // Variable name: green_rg_offset_top_H.
   // Green offset r/g for top part of the green zone only.
   // Comparing to existing green zone, negative green_rg_offset_top_H moves the top zone leftwards and positive value moves zone rightwards.
   // To show green zone in Chromatix tool, green_rg_offset_top_H <= green_rg_offset_bottom_H.
   // Default value: -40 (disable top part of the green zone before tuning).
   // Recommended data range: -40 to 40.
   // Recommended tuning step: -1 or 1.
   //
   // Variable name: green_rg_offset_bottom_H.
   // Green offset r/g for bottom part of the green zone only.
   // Comparing to existing green zone, negative green_rg_offset_top_H moves the top zone leftwards and positive value moves zone rightwards.
   // To show green zone in Chromatix tool, green_rg_offset_top_H <= green_rg_offset_bottom_H.
   // Default value: -40 (disable bottom part of the green zone before tuning).
   // Recommended data range: -40 to 50.
   // Recommended tuning step: -1 or 1.
   //
   // Variable name: slope_factor_m.
   // The parameter stands for the slope of the projection line from the center of green stats to the day light line.
   // Default value: 1.5
   // Data range: 0 to 100.
   // Effect: The smaller the value is, the smaller slope the projection line has.
   //         The resulted green scene images go towards the bluish green direction.
   //         The larger the value, the larger slope the projection line has.
   //         The resulted green scene images go towards the yellowish green direction.
   //
   // Variable name: slope_factor_m_shade.
   // Slope factor used for green zone projection in shade condition.
   // Default value: 3.0 (a must tune parameter for different sensors).
   // Data range: 0 to 100.
   //
   // Variable names: awb_cw_green_reject_threshold, awb_custom_fl_green_reject_threshold.
   // The threshold used to screen out the possible green samples for indoor CW/custom flo conditions.
   // Default value: 0 (disable, not in use).
   // Data range: 0 to 255.
   // Effect: When a stat is close to CW/CF but its green value is less than this threshold,
   //         the sample is counted as an outlier instead of a grey sample.
   //
   // Variable name: bright_green_percentage.
   // This parameter is to calculate green stats percentage threshold under outdoor condition and in between indoor/outdoor condition.
   // Default value: 6.
   // Data range: 0 to 100.
   // Constraints: This is a pre-set threshold obtained by testing.
   // Effect: Higher value results in higher threshold to consider extreme green case in outdoor or indoor/outdoor transition case.
   //
   // Variable name: dark_green_percentage.
   // This parameter is to calculate green stats percentage threshold under indoor condition and in between indoor/outdoor condition.
   // Default value: 12.
   // Data range: 0 to 100.
   // Constraints: This is a pre-set threshold obtained by testing.
   // Effect: Higher value results in higher threshold to consider extreme green case in indoor or indoor/outdoor transition case.
   //
   // Variable name: green_enhance_low_pec
   // Low green percentage for running green enhancement (not in use).
   //
   // Variable name: green_enhance_high_pec.
   // High green percentage for running green enhancement (not in use).
   //
   // Variable name: green2f_outlier_dist2.
   // Distance from CW reference point to verify whether a stat is in green zone.
   // Default value: 0.
   // Data range: 0 to 16.
   //
   // Variable name: green_enhance_gain_adjust_high.
   // Adjust gain for green enhancement with high green percentage (not in use).
   //
   // Variable name: green_zone_assist (not implemented in code).
   // Additional green zones for handling other green colors (e.g., artificial green grass) as follows:
   //
   // Variable name: zone_control.
   // Specify the control method of the corresponding extra green zone.
   // Default Value: 0.
   // Data range: 0 to 10
   //
   // Variable name: trigger_type.
   // Specify trigger point for enabling the corresponding extra green zone.
   // Default Value: 0.
   // Data range: >= 0
   //
   // Variable name: control_direction.
   // Specify the direction of zone changes.
   // Default value: 0.
   // Data range : 0 to 10.
   //
   // Variable name: detect_zone.
   // Rectangle zone for extra green color zone as follows:
   //
   // Variable name: rg_center.
   // The center point of zone in horizontal axis.
   // Default value: 0.0
   // Data range: 0.0 to 2.0
   //
   // Variable name: bg_center.
   // The center point of zone in vertical axis.
   // Default value: 0.0
   // Data range: 0.0 to 2.0
   //
   // Variable name: rg_radius_grid.
   // The horizontal offset from the center point.
   // Default value: 0.
   // Data range: 0 to 241.
   //
   // Variable name: bg_radius_grid.
   // The vertical offset from the center point.
   // Default value: 0.
   // Data range: 0 to 241.
   //
   // Variable name:  exp_index_trigger.
   // This exposure index indicates if the current extra green zone is used
   // or not under the current brightness value.
   // Data range: >= 0.
   //
   // Variable name: bright_green_exp_index.
   // green zone projection slope factor trigger point for outdoor scenes.
   // Data range (calculated): 0 to outdoor_index.
   //
   // Variable name: shade_green_exp_index.
   // Green zone projection slope factor trigger point for shade scenes.
   // Data range (calculated): outdoor_index/2 to inoutdoor_index.
   //
   // Variable name: exp_weight.
   // Exposure index buffer used with indoor outdoor midpoint to trigger slope_factor_m_shade.
   // Default value: 0.
   // Data range: 0 to 300.
   //
   // Variable name: green_proj_interp_enable
   // Enable/disable green projection interpolation.
   // If it is enabled, the green interpolation ratio will be computed and do interpolating weighted sample average
   // and green target point with the computed interpolation ratio
   // Default value: 0 - disable
   // Data range: 1 - enable 0 - disable
   //
   // Variable name: green_proj_per_low;
   // Threshold used for determining interpolation ratio based on green stats percentage.
   // The offset percentage used with green_threshold for determining the lowest green percentage threshold.
   // If the stats percentage is lower than the final threshold, green_interpolation_ratio = 0.
   // Default value: 2.0
   // Data range: [0,50]
   // Constraint: green_proj_per_low <= green_proj_per_high
   //
   // Variable name: green_proj_per_high;
   // Threshold used for determining interpolation ratio based on green stats percentage.
   // The offset percentage used with green_threshold for determining high green percentage threshold.
   // The interpolation ratio will be computed between the lowest green percentage threshold and this green percentage threshold
   // Default value: 20.0
   // Data range: [0,80]
   // Constraints: green_proj_per_high >= green_proj_per_low
   //              green_proj_per_high <= green_proj_per_max
   //
   // Variable name: green_proj_per_max;
   // The maximum threshold used for determining interpolation ratio based on green stats percentage.
   // The offset percentage used with green_threshold for determining the maximum green percentage threshold.
   // If the stats percentage is lower than the final threshold, the interpolation ratio will be between maximum interpolation ratio and interpolation ratio computed with high green percentage threshold,
   // If the stats percentage is higher than the final threshold, interpolation ratio will be green_proj_per_max_ratio.
   // Default value: 80.0
   // Data range: [50,100]
   // Constraints: green_proj_per_max >= green_proj_per_high
   //
   // Variable name: green_proj_per_max_ratio;
   // The maximum interpolation ratio.
   // If the green percentage is larger than the maximum green percentage threshold (green_proj_per_max+ green)_threhsold),
   // this maximum ratio should be the interpolation ratio.
   // Default value: 1.2
   // Data range: [1.0,2.0]
   // Constraints:
   //
   // Variable name: green_proj_index_start;
   // Threshold used for determining interpolation ratio based on exposure index.
   // If the current exposure index is lower than this index, no changes on the interpolation ratio.
   // Note that we change the interpolation ratio that has been already computed by green percentage thresholds
   // Default value: 210.0
   // Data range: [150,300]
   // Constraints: green_proj_index_start >= outdoor_heuristic_exposure_index_trigger
