      // Default Value: 300.
      // Data range: 0 to 500.
      //
      // Variable name: flat_indoor_disable_end_idx.
      // If exposure index is bigger than this variable, flat scene compensation
      //   is completely disabled.
      // Default Value: 340.
      // Data range: 0 to 500.
      /*********************************************************************/

